                        "Desc": "Благодаря знаниям о том, как управлять скоростью и волнами, Муалани способна заниматься сёрфингом  где и когда угодно.<br>После активации навыка Муалани получает 60 очков Ночного духа и переходит в состояние Благословения Ночного духа.<br><br><color style='color:#FFD780;'>Благословение Ночного духа: Муалани</color><br>Непрерывно расходует очки Ночного духа. Когда они исчерпаются или навык используется повторно, Благословение Ночного духа Муалани завершается. У состояния Благословения Ночного духа следующие особенности:<br> ·  Муалани взбирается на доску-акулу, причём её скорость передвижения повышается. В этом состоянии Муалани может перемещаться по воде и жидкому флогистону, не получая урона от последнего.<br> ·  Обычные атаки превращаются в Укусы акулы, которые наносят <color style='color:#80C0FF;'>Гидро урон</color> с характеристикой Ночного духа, пропорциональный макс. HP Муалани. Укусы акулы можно производить в воздухе. Урон, наносимый таким способом, считается уроном обычной атаки.<br> ·  Соприкасаясь со врагами в этом состоянии, Муалани накладывает на них Метки добычи и получает 1 уровень Заряда волн. Заряд волн складывается до 3 раз.<br><br><color style='color:#FFD780;'>Заряд волн и Метки добычи</color><br>Когда Муалани выполняет Укусы акулы, их урон увеличивается согласно количеству уровней Заряда волн. Когда в наличии 3 уровня, Укус акулы превращается в Разрывающий укус акулы, ещё больше повышая урон и очищая все уровни.<br>Когда Укусы акулы достаются противникам с Метками добычи, метки снимаются, и Муалани выпускает Акульи ракеты в сторону максимум 5 противников поблизости с Метками добычи, урон которых равен урону текущего Укуса акулы. Если целей Укуса акулы и Акульих ракет более 1, наносимый урон снизится, причём максимальное снижение урона - 24%, когда количество целей не менее 3.<br><br><i>Во-первых, доска-акула не только доска для сёрфинга, но и пресноводная акула. Во-вторых, он не ест, но кусается точно.</i>",
