                        "Name": "Волнорезная сёрф-акула",
                        "Desc": "Благодаря знаниям о том, как управлять скоростью и волнами, Муалани способна заниматься сёрфингом где и когда угодно.<br>После активации этого навыка Муалани получает 60 очков Ночного духа и переходит в состояние Благословения Ночного духа.<br><br><color style='color:#FFD780;'>Благословение Ночного духа: Муалани</color><br>Непрерывно расходует очки Ночного духа. Когда они заканчиваются или навык используется повторно, Благословение Ночного духа Муалани завершается. У состояния Благословения Ночного духа следующие особенности:<br> ·  Муалани взбирается на сёрф-акулу, её скорость передвижения и сопротивление прерыванию повышается. Пока это состояние активно, Муалани может перемещаться по воде и жидкому флогистону, не получая урона от последнего.<br> ·  Обычные атаки превращаются в Укусы акулы, которые наносят <color style='color:#80C0FF;'>Гидро урон</color> с характеристикой Ночного духа, пропорциональный макс. HP Муалани. Укусы акулы можно производить в воздухе. Урон, наносимый таким способом, считается уроном обычной атаки.<br> ·  Соприкасаясь в этом состоянии с врагами, Муалани накладывает на них Метки добычи и получает 1 уровень Импульса волн. Импульс волн складывается до 3 раз. За одного и того же врага можно получить 1 уровень раз в 0,7 сек.<br><br><color style='color:#FFD780;'>Импульс волн и Метки добычи</color><br>Когда Муалани использует Укусы акулы, наносимый ею урон увеличивается согласно количеству уровней Импульса волн. Когда в наличии 3 уровня, Укус акулы превращается в Разрывающий укус акулы, ещё больше повышая урон и впоследствии снимая все уровни.<br>Когда Укусы акулы попадают по противнику с Меткой добычи, Метка снимается, и выпускаются Акульи ракеты в максимум 5 противников с Метками добычи поблизости. Они наносят урон, равный урону данного Укуса акулы, и снимают Метки. Если целей Укуса акулы и Акульих ракет более 1, наносимый урон снижается, максимальное снижение урона - 28%, если целей 3 и больше.<br><br><i>Во-первых, сёрф-акула не только доска для сёрфинга, но и пресноводная акула. Во-вторых, она не ест, но кусается очень даже по-настоящему.</i>",
